import * as React from 'react';
import { DataGrid } from '@mui/x-data-grid';
import Paper from '@mui/material/Paper';

export default function ShoppingCart(){
    const columns = [
        { field: 'productName', headerName: 'Product name', width: 130 },
        {
          field: 'productPrice',
          headerName: 'Price',
          type: 'number',
          width: 90,
        },
        {
            field: 'qty',
            headerName: 'Quantity',
            type: 'number',
            width: 130,
        }
      ];
      
      const rows = [
        {productName:"Item 1", qty:1, price:4.00},
        {productName:"Item 2", qty:1, price:5.00},
        {productName:"Item 3", qty:1, price:6.00},
      ];
      
    return(
        <Paper sx={{ height: 400, width: '100%' }}>
            <DataGrid
                rows={rows}
                columns={columns}
                checkboxSelection
                sx={{ border: 0 }}
            />
        </Paper>
    );
}
